import React from "react";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";
import { Links } from "../utils/constants";
import { ProductState } from "../reducers/reducer";

const NavMenuTop = () => {
  const state = useSelector((state: ProductState) => ({ ...state.products }));
  return (
    <nav className="topnav">
      <div className="container">
        <div className="row">
          <div className="col-12 col-sm-12 col-md-12 col-lg-9 col-xl-10">
            <div className="flexmenu">
              <a className="hamburger" title="Развернуть меню">
                <span></span>
                <span></span>
                <span></span>
              </a>
              <Link className="logo_mobile" to="/">
                <img src="images/logo.png" width="75" alt="лого" />
              </Link>
              <span className="phone_mobile">
                <a href="tel:+375447345678">8-044-734-56-78</a>
              </span>
              <ul>
                {Links.map((link) => (
                  <li className="level1" key={link.path}>
                    <Link to={link.path}>{link.text}</Link>
                    {link.children && (
                      <ul>
                        {link.children.map((child) => (
                          <li className="level2" key={child.path}>
                            <Link to={child.path}>{child.text}</Link>
                          </li>
                        ))}
                      </ul>
                    )}
                  </li>
                ))}
              </ul>
            </div>
          </div>
          <div className="col-12 col-sm-12 col-md-12 col-lg-3 col-xl-2 topnav_cart">
            {/*state.products &&
              state.products.map((product) => (
                <div key={product.id}>{product.title}</div>
              ))*/}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default NavMenuTop;
